    [],nt"num_tags": 0,nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-time3ada6",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0100084 includes chemical,
    physical, and time series data collected from MOORINGS in the North Pacific Ocean
    from 1997-11-14 to 2010-08-25. These data include CARBON DIOXIDE - AIR, CARBON DIOXIDE
    - PARTIAL PRESSURE - DIFFERENCE, OXYGEN - PERCENT SATURATION, Partial pressure (or
    fugacity) of carbon dioxide, SALINITY and SEA SURFACE TEMPERATURE. The instruments
    used to collect these data include Bubble type equilibrator for autonomous carbon
    dioxide (CO2) measurement and Carbon dioxide (CO2) gas analyzer.nnThese data were
    collected by Francisco Chavez of Monterey Bay Aquarium Research Institute and Adrienne
    Sutton and Christopher Sabine of US DOC; NOAA; OAR; Pacific Marine Environmental
    Laboratory as part of the Mooring_TAO155W data set. CDIAC assigned the following
    cruise ID(s) to this data set: TAO_19971114.nnThe Global CO2 Time-series and Moorings
    Project involves international groups from 18 countries who have mounted sensors
    on moored buoys to provide high resolution time-series measurements of atmospheric
